import { Component, OnInit } from '@angular/core'
import { ActivatedRoute } from '@angular/router'

import { faPaw, faVenusMars, faCalendar, faArrowLeftLong, faPenToSquare, faTrash } from '@fortawesome/free-solid-svg-icons'
import { AllPets } from '../../models/all-pets-model'
import { PetModel } from '../../models/pet-model'
import { PetService } from '../../services/pet-service.service'
import { PetInfo } from 'src/app/models/pet-info-model'

@Component({
  selector: 'app-info-pet',
  templateUrl: './info-pet.component.html',
  styleUrls: ['./info-pet.component.scss'],
})
export class InfoPetComponent implements OnInit {
  // pet: AllPets = {
  //     id: '1',
  //     nome: 'Pet 1',
  //     raca: 'Breed 1',
  //     idade: '2',
  //     data_cad: '',
  //     perdido: '1',
  //     petImage: "",
  //   }
  petList: PetModel[] = []
  fapaw = faPaw
  favenus = faVenusMars
  facalendar = faCalendar
  faPenToSquare = faPenToSquare
  faArrowLeftLong = faArrowLeftLong
  faTrash = faTrash
  petId!: string
  pet!: PetModel
  userId!: string

  constructor (
    private router: ActivatedRoute, 
    private petService: PetService,
  ) {}

  ngOnInit(): void {
    this.router.params.subscribe(param => {
      this.petId = param["id"]
    })

    this.petService.getPet(this.petId).subscribe(res => this.pet = res)
  }
  
  deletePet(petId: string): void {
    this.petService.deletePet(petId).subscribe(() => {
      alert('Pet deletado')
    })
  }
}
